window.bookSummaryJSON = "<p><b>Unlikely allies uniting across the world. Blood feuds that span centuries. A single chance at life.</b></p> <p>The world watches the sky with trepidation. The insanity of Xenocide knew no bounds, and all will soon suffer the effects he had planned for a millennium. Though none know what is to come, they all know it isn't going to be easy to survive.</p> <p>The Master has a plan, one that can give the world at large a way to escape the onrushing desolation. It may be on the bleeding edge of morality and what he needs might prove too difficult to secure, but the Master asks for trust.</p> <p>Cal and Dale both have their role to play as the world hurtles toward destruction. One needs to bring the races of the world together while the other simply needs to survive. Surrounded by supposed allies, the duo will do all that they can to succeed - but with every new arrival comes rising tensions and faltering trust.</p> <p>The apocalypse is coming. Will honor or greed stand the test of time?</p>"; 
